// pages/Booking.jsx
import { useParams } from 'react-router-dom';
import { useEffect, useState } from 'react';

export default function Booking() {
  const { id } = useParams();
  const [truck, setTruck] = useState(null);

  useEffect(() => {
    // Example: simulate API fetch
    const fetchTruck = async () => {
      // Replace with real fetch:
      // const res = await fetch(`/api/trucks/${id}`);
      // const data = await res.json();
      const data = {
        id,
        name: `Truck #${id}`,
        capacity: '15 tons',
        rate: id * 100,
      };
      setTruck(data);
    };

    fetchTruck();
  }, [id]);

  if (!truck) return <div>Loading...</div>;

  return (
    <div>
      <h2>Book {truck.name}</h2>
      <p><strong>Capacity:</strong> {truck.capacity}</p>
      <p><strong>Rate per day:</strong> ${truck.rate}</p>
      {/* Add form fields or booking button */}
      <button className="mt-4 bg-green-600 text-white px-4 py-2 rounded">
        Confirm Booking
      </button>
    </div>
  );
}
